create table Theatre (
	TheatreName VARCHAR(50),
	Theatre_Id INT,
	StreetNumber VARCHAR(50),
	Street VARCHAR(50),
	State VARCHAR(50),
	City VARCHAR(50),
	Zip VARCHAR(50)
);

create table Showing (
	Showing_Id INT,
	Movie_Id INT,
	Auditorium_Id INT,
	Date DATE,
	StartTime VARCHAR(50)
);

create table Screens (
	Showing_Id INT,
	Auditorium_Id INT
);

create table Movie (
	Movie_Id INT,
	Title VARCHAR(50),
	Rating DECIMAL(3,2),
	Genre VARCHAR(50),
	ReleaseDate DATE,
	Director VARCHAR(50)
);

create table Features (
	Movie_Id INT,
	Showing_Id INT
);

create table Employee (
	SSN VARCHAR(50),
	FName VARCHAR(50),
	MName VARCHAR(50),
	LName VARCHAR(50),
	Employee_Id INT,
	DateOfBirth DATE,
	DateOfHire DATE
);

create table Auditorium (
	Theatre_Id INT,
	Auditorium_No INT
);

create table Assigned_To (
	Employee_Id INT,
	Auditorium_Id INT
);

